import React, {Component} from 'react';
import styles from './home.module.scss';
import yangUrl  from '../../assets/images/yang.jpg';

export default ()=>{
    return <div className={styles.wrap}>
        {/* introduce */}
    <section className={styles.brief}>
        {/* <img src={ require("../../assets/images/153523579.jpg") } /> */}
         <img src={yangUrl}></img>
        <h2> Yang LIU</h2>
        <ul>
            <li> Front-end developer</li>
            <li> Full stack developer</li>
            <li> react </li>
            <p>Actively seeking internship or junior position jobs for web developer. </p>
            <p>I am a faster learner with strong self-learning ability and communication skills. </p>
            <p>I am also good at front-end development to design web pages.
            </p>
        </ul>
    </section>
    </div>
}
